import React from "react";

const Task = ({ loggedIn }) => {
  return (
    <div>
      {loggedIn ? (
        // Render content for a logged-in user
        <div>Task</div>
      ) : (
        // Render content for a non-logged-in user
        <p>Please log in to access the task.</p>
      )}
    </div>
  );
};

export default Task;
